import {Row, Col, Button} from "antd";

function Header() {
	return (
		<Row>
			<Col xs={2} sm={4} md={6} lg={6} xl={6}>
				<Button type="primary">Download</Button>
			</Col>
			<Col xs={2} sm={4} md={6} lg={18} xl={18}>
				<Button type="primary">Download</Button>
			</Col>
		</Row>
	);
}

export default Header;
